import React from 'react'
import Item from './Item';

const initialItems = [
  { id: 1, description: "Passports", quantity: 2, packed: false },
  { id: 2, description: "Socks", quantity: 12, packed: false },
];
const PackingLists = () => {
  return (
    <ul className='list'>
        {initialItems.map((item)=>{
            <Item item={item}/>
        })}
    </ul>
  )
}

export default PackingLists
